        <div className="hotelDetaImgBox"><img src="" alt="" /></div>
        <div className="hotelDetaImgBox"><img src="" alt="" /></div>
        <div className="hotelDetaImgBox"><img src="" alt="" /></div>
        <div className="hotelDetaImgBox"><img src="" alt="" /></div>
      </div>
    </div>
  );
}

export default HotelDetailes;
